  const contacts = [
    {
      id: "1",
      name: "Dinish",
      email: "3359767@gmail.com",
    },
    {
      id: "1",
      name: "",
      email: "7679533@gmail.com",
    },
  ];

  return (
   <div className="ui container">
     <Header/>
     <AddContact/>
     <ContactList/>
   </div>
  )
}

export default App;
